import classes from '../../CSS/Main.module.css'
import Logo from '../../Assets/Navbar/Logo.png'
import Progress from './LoadingElem';

const Navbar = props => {

    const [loadState, setloadState] = useState({
        loadprog: 0
    });
    const LoadPage = () =>{
        setloadState({
            loadprog: 30
        },500)
        setloadState({
            loadprog: 70
        },1000)
        setloadState({
            loadprog: 100
        },1500)
        setloadState({
            loadprog: 101
        },1600)
    }
    const LoadBar = () =>{

    }
    return(
       <main className={classes.Navbar}>
            <nav className={classes.NavbarBody}>
                <a href='/'><img className={classes.Logo} src={Logo} alt="Logo"></img></a>
                <ul className={classes.NavButtons}>
                    <li className={classes.NavButton}>
                            <a href="javascript: void(0)" onClick={LoadPage}>PLAY</a></li>
                    <li className={classes.NavButton}>
                        <a href="javascript: void(0)" onClick={LoadPage}>RANKINGS</a></li>
                </ul>
                <ul className={classes.NavButtonLogin}>
                    <li className={classes.NavButton}>
                            <a href="javascript: void(0)" onClick={LoadPage}>LOGIN</a></li>
                </ul>
            </nav>
            <Progress complete={loadState.loadprog}/>
        </main> 
    )
};
export default Navbar;
